using LookAtMe.Web.API.Data.Context;
using LookAtMe.Web.API.Data.Interfaces;
using LookAtMe.Web.API.Data.Repository;
using LookAtMe.Web.API.Domain.Interfaces;
using LookAtMe.Web.API.Domain.Model;
using LookAtMe.Web.API.Services;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using System;
using System.Linq;

namespace LookAtMeTest
{
    [TestClass]
    public class AlertaServiceTest
    {

        private Alerta alerta1 = new Alerta()
        {
            Id = 100,
            DataHoraRegistro = DateTime.Now,
            Estado = "Aberto",
            NumeroOnibus = 501,
            Latitude = -20.293860,
            Longitude = -40.301165,
            SuspeitoId = 10,
            UrlFoto = /*"data:image/jpeg;base64,"*/"",
            Capturado = false
        };
        private Alerta alerta2;

        private Alerta alerta3 = new Alerta()
        {
            Id = 300,
            DataHoraRegistro = DateTime.Now.AddDays(-3),
            Estado = "Em Andamento",
            NumeroOnibus = 501,
            Latitude = -20.293810,
            Longitude = -40.301120,
            SuspeitoId = 100,
            UrlFoto = /*"data:image/jpeg;base64,"*/"",
            Capturado = false
        };
        private Alerta alerta4 = new Alerta()
        {
            Id = 400,
            DataHoraRegistro = DateTime.Now.AddDays(-3),
            Estado = "Fechado",
            NumeroOnibus = 508,
            Latitude = -20.293100,
            Longitude = -40.301200,
            SuspeitoId = 10,
            UrlFoto = /*"data:image/jpeg;base64,"*/"",
            Capturado = false
        };

        private readonly IAlertaService alertaService;
        private readonly IAlertaRepository _alertaRepository;

        public AlertaServiceTest(IAlertaService alertaService,
                                 IAlertaRepository alertaRepository)
        {
            this.alertaService = alertaService;
            _alertaRepository = alertaRepository;
        }

        [TestMethod]
        public void CriarAlertaTest()
        {

            alertaService.CriarAlerta(alerta1);

            var alertaRepositorio = _alertaRepository.GetAll();
            var existe = alertaRepositorio.FirstOrDefault(x => x.Id == alerta1.Id);
            if (existe == null)
            {
                Console.WriteLine("erro ao criar alerta");
            }

        }

        [TestMethod]
        public void AtualizarAlertaTest()
        {
            alerta2 = alerta1;
            alerta2.Estado = "Em Andamento";
            alertaService.AtualizarAlerta(alerta2);

            var alertaRepositorio = _alertaRepository.GetAll();
            var existe = alertaRepositorio.FirstOrDefault(x => x.Id == alerta2.Id);
            if (existe == null || existe.Estado != "Em Andamento")
            {
                Console.WriteLine("erro ao atualizar alerta");
            }
        }

        [TestMethod]
        public void CancelarAlertaTest()
        {
            alertaService.CancelarAlerta(alerta2);

            var alertaRepositorio = _alertaRepository.GetAll();
            var existe = alertaRepositorio.FirstOrDefault(x => x.Id == alerta2.Id);
            if (existe == null || existe.Estado != "Cancelado")
            {
                Console.WriteLine("erro ao cancelar alerta");
            }
        }

        [TestMethod]
        public void GetAlertaByIdTest()
        {
            var alerta = alertaService.GetAlertaById(alerta1.Id);

            if (alerta == null)
            {
                Console.WriteLine("erro ao pegar alerta");
            }
        }

        [TestMethod]
        public void GetAlertasByEstadoAsyncTest()
        {
            alerta1.Id = 200;
            alertaService.CriarAlerta(alerta1);
            alertaService.CriarAlerta(alerta3);
            alertaService.CriarAlerta(alerta4);
            var alerta = alertaService.GetAlertasByEstadoAsync("Aberto");
            if (alerta != null)
            {
                Console.WriteLine("erro ao pegar alerta aberto");
            }
            alerta = alertaService.GetAlertasByEstadoAsync("Em Andamento");
            if (alerta != null)
            {
                Console.WriteLine("erro ao pegar alerta em andamento");
            }
            alerta = alertaService.GetAlertasByEstadoAsync("Fechado");
            if (alerta != null)
            {
                Console.WriteLine("erro ao pegar alerta fechado");
            }
            alerta = alertaService.GetAlertasByEstadoAsync("Cancelado");
            if (alerta != null)
            {
                Console.WriteLine("erro ao pegar alerta cancelado");
            }
        }

        [TestMethod]
        public void GetAlertasAsyncTest()
        {
            var alertas = alertaService.GetAlertasAsync().GetAwaiter().GetResult();
            if (alertas.Count == 0)
            {
                Console.WriteLine("erro ao pegar alertas");
            }
        }

        [TestMethod]
        public void GetAlertasTest()
        {
            var alertas = alertaService.GetAlertas();
            if (alertas.Count == 0)
            {
                Console.WriteLine("erro ao pegar alertas");
            }
        }

        [TestMethod]
        public void GetAlertasByIdSuspeitoTest()
        {
            var alertas = alertaService.GetAlertasByIdSuspeito(alerta1.SuspeitoId);
            if (alertas.Count == 0)
            {
                Console.WriteLine("erro ao pegar alertas relacionados ao suspeito");
            }
        }

        [TestMethod]
        public void DeletarAlertaTest()
        {
            alertaService.DeletarAlerta(alerta1.Id);
            alertaService.DeletarAlerta(alerta2.Id);
            alertaService.DeletarAlerta(alerta3.Id);
            alertaService.DeletarAlerta(alerta4.Id);

            var alertaRepositorio = _alertaRepository.GetAll();
            var existe = alertaRepositorio.FirstOrDefault(x => x.Id == alerta1.Id);
            if (existe != null)
            {
                Console.WriteLine("erro ao deletar alerta1");
            }
            existe = alertaRepositorio.FirstOrDefault(x => x.Id == alerta2.Id);
            if (existe != null)
            {
                Console.WriteLine("erro ao deletar alerta2");
            }
            existe = alertaRepositorio.FirstOrDefault(x => x.Id == alerta3.Id);
            if (existe != null)
            {
                Console.WriteLine("erro ao deletar alerta3");
            }
            existe = alertaRepositorio.FirstOrDefault(x => x.Id == alerta4.Id);
            if (existe != null)
            {
                Console.WriteLine("erro ao deletar alerta4");
            }
        }



    }
}
